var NoModuleComponent = (function () {
    function NoModuleComponent() {
    }
    NoModuleComponent.prototype.getBuffer = function () {
        return new Buffer("hello");
    };
    return NoModuleComponent;
}());
describe("NoModuleComponent", function () {
    it("should use no modules without the bundle loader crashing and burning", function () {
        expect(new NoModuleComponent().getBuffer()).toEqual(new Buffer("hello"));
    });
});
